import { Typography } from "@mui/material";
import { Box } from "@mui/system";
import React from "react";
import {
  LineChart,
  Line,
  XAxis,
  YAxis,
  CartesianGrid,
  Tooltip,
  Legend,
  Label,
} from "recharts";

function getMin(min, max, data) {
  let local_min = 0;
  for (let i = 0; i < data.length; i++) {
    console.log(data[i]);
  }
  return 
}

function getMax(min, max, data) {
  let local_min = 0;
  for (let i = 0; i < data.length; i++) {
    console.log(data[i]);
  }
  return 
}


export default function VolumeTimeGraph(props) {
  let minRange = getMin(maxRange, props.data);
  let maxRange = getMax(maxRange, props.data);

  return (
    <Box sx={{ py: 5 }}>
      <Box sx={{ width: 410, marginLeft: 30 }}>
        <Typography variant="h5" align="center">
          {props.title}
        </Typography>
      </Box>
      <LineChart
        width={800}
        height={300}
        data={props.data}
        margin={{
          top: 20,
          right: 10,
          left: 20,
          bottom: 20,
        }}
      >
        <CartesianGrid strokeDasharray="1 1" />
        <XAxis dataKey="date">
          <Label position="bottom" style={{ textAnchor: "middle" }}>
            Date
          </Label>
        </XAxis>
        <YAxis unit=' mL' type="number" domain={[2300, 2500]}>
          <Label angle={270} position="left" style={{ textAnchor: "middle" }}>
            Volume
          </Label>
        </YAxis>
        <Tooltip />
        <Legend />
        <Line
          type="monotone"
          dataKey="val"
          legendType="none"
          stroke="#8884d8"
          activeDot={{ r: 8 }}
        />
      </LineChart>
    </Box>
  );
}
